import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

import './SignUp.css'; 
import GoogleLogo from '../assets/Google__G__logo.svg';

const SignUp = () => {
    const [userData, setUserData] = useState({
        name: '', // Corregido de 'email' a 'name'
        lastnames: '',
        email: '',
        password: '',
        confirmPassword: '' // Añadido para confirmar contraseña
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Lógica para manejar el envío de datos
    };

    return (
        <div className="container-registro">
            <form className="formulario-registro" onSubmit={handleSubmit}>
                <div className="columna-flexible">
                    <label className="etiqueta">Nombre</label>
                    <div className="contenedor-input">
                        <input
                            type="text" // Cambiado de 'name' a 'text'
                            className="campo-input"
                            placeholder="Ingresa tu nombre"
                            name="name"
                            value={userData.name}
                            onChange={handleChange}
                        />
                    </div>
                </div>

                <div className="columna-flexible">
                    <label className="etiqueta">Apellidos</label>
                    <div className="contenedor-input">
                        <input
                            type="text" // Cambiado de 'lastnames' a 'text'
                            className="campo-input"
                            placeholder="Ingresa tus apellidos"
                            name="lastnames"
                            value={userData.lastnames}
                            onChange={handleChange}
                        />
                    </div>
                </div>


                <div className="columna-flexible">
                    <label className="etiqueta">Correo electrónico</label>
                    <div className="contenedor-input">
                        <input
                            type="email"
                            className="campo-input"
                            placeholder="Ingresa tu correo electrónico"
                            name="email"
                            value={userData.email}
                            onChange={handleChange}
                        />
                    </div>
                </div>

                <div className="columna-flexible">
                    <label className="etiqueta">Contraseña</label>
                    <div className="contenedor-input">
                        <input
                            type="password"
                            className="campo-input"
                            placeholder="Ingresa tu contraseña"
                            name="password"
                            value={userData.password}
                            onChange={handleChange}
                        />
                    </div>
                </div>

                <div className="columna-flexible">
                    <label className="etiqueta">Confirma tu contraseña</label>
                    <div className="contenedor-input">
                        <input
                            type="password"
                            className="campo-input"
                            placeholder="Ingresa tu contraseña nuevamente"
                            name="confirmPassword"
                            value={userData.confirmPassword}
                            onChange={handleChange}
                        />
                    </div>
                </div>

                <div className="fila-flexible">
                    <div className="contenedor-checkbox">
                        <input type="checkbox" className="checkbox" />
                        <label className="etiqueta">Acepto los términos y condiciones</label>
                    </div>
                </div>

                <button className="boton-enviar">Registrarse</button>

                <p className="p line">O registrate con:</p>

                <div className="contenedor-boton-social">
                    <button className="boton-social google">
                        <img src={GoogleLogo} alt="Google Logo"/>
                    </button>
                </div>

                <p className="p">
                    ¿Ya tienes una cuenta?   
                    <NavLink to="/iniciar-sesión" className="texto-enlace"> 
                        ¡Inicie sesión!
                    </NavLink>
                </p>
            </form>
        </div>
    );
};

export default SignUp;
